import React from 'react';
import PropTypes from 'prop-types';

const VideoList = (props) => {
  const { videos } = props;

  return (
    <div>
      <video></video>
    </div>
  );
};

VideoList.propTypes = {
  videos: PropTypes.arrayOf(PropTypes.object).isRequired,
};

export default VideoList;
